CREATE TABLE `cotizacion` (
  `idcotizacion` binary(16) NOT NULL DEFAULT (uuid_to_bin(uuid())),
  `idContrato` binary(16) NOT NULL,
  `version` int DEFAULT NULL,
  `idestadoCotizacion` int NOT NULL,
  `fechaEmision` date NOT NULL,
  `fechaVigenciaDesde` date DEFAULT NULL,
  `fechaVigenciaHasta` date DEFAULT NULL,
  `observacion` varchar(255) DEFAULT NULL,
  `idUsuarioCreacion` varchar(20) NOT NULL,
  `fechaRegistro` datetime DEFAULT CURRENT_TIMESTAMP,
  `fechaModificacion` datetime DEFAULT CURRENT_TIMESTAMP,
  `numeroCotizacion` varchar(45) NOT NULL,
  PRIMARY KEY (`idcotizacion`),
  KEY `fk_cotizacion_usuario1_idx` (`idUsuarioCreacion`),
  KEY `fk_cotizacion_estadoCotizacion1_idx` (`idestadoCotizacion`),
  KEY `fk_cotizacion_contrato1_idx` (`idContrato`),
  CONSTRAINT `fk_cotizacion_contrato1` FOREIGN KEY (`idContrato`) REFERENCES `contrato` (`idContrato`),
  CONSTRAINT `fk_cotizacion_estadoCotizacion1` FOREIGN KEY (`idestadoCotizacion`) REFERENCES `estadocotizacion` (`idestadoCotizacion`),
  CONSTRAINT `fk_cotizacion_usuario1` FOREIGN KEY (`idUsuarioCreacion`) REFERENCES `usuario` (`idusuario`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
