/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_cotizacion_primer_estado` AFTER INSERT ON `cotizacion` FOR EACH ROW BEGIN
    -- Registrar el estado inicial de la cotización
    INSERT INTO cotizacionhistorial (
        idCotizacion,
        idEstadoAnterior,
        idEstadoNuevo,
        idUsuario,
        comentario,
        fechaCambio
    )
    VALUES (
        NEW.idcotizacion,
        NULL,
        NEW.idestadoCotizacion,
        NEW.idUsuarioCreacion,
        CONCAT(
            'Cotización creada - Versión: ',
            COALESCE(NEW.version, 1)
        ),
        NOW()
    );
END */;;
