/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_cotizaciondetalle_after_insert` AFTER INSERT ON `cotizaciondetalle` FOR EACH ROW BEGIN
    DECLARE v_es_oneshot INT;
    
    -- Verificar si es ONE_SHOT
    SELECT meses INTO v_es_oneshot 
    FROM periodicidad 
    WHERE idPeriodicidad = NEW.idPeriodicidad;
    
    -- Insertar o actualizar total
    INSERT INTO cotizaciontotal (
        idCotizacion, 
        idTipoMoneda,
        totalOneShot,
        totalMensual
    ) VALUES (
        NEW.idCotizacion,
        NEW.idTipoMoneda,
        CASE WHEN v_es_oneshot = 0 THEN NEW.subtotal ELSE 0 END,
        CASE WHEN v_es_oneshot > 0 THEN NEW.subtotal ELSE 0 END
    )
    ON DUPLICATE KEY UPDATE
        totalOneShot = totalOneShot + CASE WHEN v_es_oneshot = 0 THEN NEW.subtotal ELSE 0 END,
        totalMensual = totalMensual + CASE WHEN v_es_oneshot > 0 THEN NEW.subtotal ELSE 0 END,
        totalAnual = totalMensual * 12;
END */;;
