/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trg_cotizaciondetalle_after_update` AFTER UPDATE ON `cotizaciondetalle` FOR EACH ROW BEGIN
    -- Si cambió cantidad, precio o moneda, recalcular totales
    IF OLD.cantidad <> NEW.cantidad 
       OR OLD.precioUnitario <> NEW.precioUnitario 
       OR OLD.idTipoMoneda <> NEW.idTipoMoneda
       OR OLD.idPeriodicidad <> NEW.idPeriodicidad THEN
        
        -- Restar valores antiguos
        CALL sp_actualizar_totales_cotizacion(OLD.idCotizacion);
        
        -- Si cambió la moneda, también actualizar la nueva
        IF OLD.idTipoMoneda <> NEW.idTipoMoneda THEN
            CALL sp_actualizar_totales_cotizacion(NEW.idCotizacion);
        END IF;
    END IF;
END */;;
