    -- Eliminar totales existentes
    DELETE FROM cotizaciontotal WHERE idCotizacion = p_idCotizacion;
    
    -- Recalcular y reinsertar
    INSERT INTO cotizaciontotal (
        idCotizacion,
        idTipoMoneda,
        totalOneShot,
        totalMensual,
        totalAnual
    )
    SELECT 
        cd.idCotizacion,
        cd.idTipoMoneda,
        SUM(CASE WHEN p.meses = 0 THEN cd.subtotal ELSE 0 END) as totalOneShot,
