        SUM(CASE WHEN p.meses > 0 THEN cd.subtotal ELSE 0 END) * 12 as totalAnual
    FROM cotizaciondetalle cd
    JOIN periodicidad p ON cd.idPeriodicidad = p.idPeriodicidad
